  false,\n\t\"url\": null,\n\t\"notes\": \"This polygon feature class represents vegetation
  communities mapped at Hovenweep National Monument. The polygons were generated using
  guidelines set by the USGS-NPS Vegetation Mapping Program (http://biology.usgs.gov/npsveg/standards.html).
  Original vegetation map unit lines were drawn on mylar overlays of the project photography,
  then scanned to generate the linework. Due to the \"snapshot\" nature of the aerial
  photography, this vegetation layer largely reflects conditions that existed when
  the imagery was collected (August 1996).\",\n\t\"license_title\": null,\n\t\"extras\":
